import axios from "axios";

const BASE_URL = "http://localhost:5000/api/";
const TOKEN = "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjYyZDAyOWJjODg4YmU4ZDU5ZjIwY2FlNyIsImlzQWRtaW4iOnRydWUsImlhdCI6MTY1OTQyODY1MSwiZXhwIjoxNjU5Njg3ODUxfQ.FGHG5J0At9GPjkHVK4PeNBfkkpgWgpC2aofQLBNv5_8";

export const publicRequest = axios.create({
    baseURL: BASE_URL,
});

export const userRequest = axios.create({
    baseURL: BASE_URL,
    header: {token: `Bearer ${TOKEN}`}
});
